import React from 'react';
import CustomNavbar from './components/NavBar';
import ProductList from './components/ProductList';
import ProductForm from './components/ProductForm';


function App() {
  return (
    <div>
      <CustomNavbar />
    <div className="App">
      <div className="container">
        <ProductList />
      </div>
    </div>
    </div>

  );
}

export default App;
